css:
#container{
    display: flex;
    flex-direction: column;
}
#createNewYearContainer{
    display: flex;
    justify-content: flex-end;
    flex-direction: row;
    float: right;                
}
#createNewYearBtn{
    color: #fff;
    border: none;
    text-transform: uppercase;
    padding: 10px 15px;
    background-color: rgb(21, 189, 244);
    cursor: pointer;
    border-radius: 10px;
    margin: 10px 50px 0 0;
    outline: none;
}
#yearContainer{
    margin: 15px;
    display: flex;
    flex-direction: row;
    flex-wrap: wrap;
    max-width: 1230px;
    margin: 0 auto;
}
.month{
    background-color: transparent;
    margin: 10px;
    border: 2px solid black;
    display: flex;
    max-width: 284px;
    flex-wrap: wrap;                    
}
.emptyDay{
    background-color: transparent!important;
}
.day{
    background-color: #a9d08e;
    cursor: pointer;
}
.calenDay{
    border: 1px solid black;
    width: 40px;
    height: 30px;
    display: flex;
    align-items: center;
    justify-content: center;
    font-weight: 600;
}
.calenDay:nth-child(7n){
    background-color: #f4b084;
}
.calenDay:nth-child(7n-1){
    background-color: #f4b084;
}
.monthTitle{
    text-align: center;
    font-size: 20px;
    font-weight: 600;                    
}
.monthWrapper{
    display: flex;
    flex-direction: column;  
    margin: 15px 0px;
}
